const section1Links = [['https://www.youtube.com/embed/gMiq50rNOlA', '1.1 Printing to the console']]

const sectionLinksList = [null, section1Links]

class VideoModel {
    constructor({link, videoTitle}){
        this.link = link;
        this.videoTitle = videoTitle;
    }
}

class VideoPageModel {
    constructor(videos, pageTitle, ){
        this.videos = videos;
        this.pageTitle = pageTitle;
    }
}

export default {sectionLinksList, VideoModel};
